function stringify(number, space = 4) {
    if (number === 0) return "0";
    let res = "";
    let i = 0;
    while (number > 0) {
        let char = (number % 10);
        number = ~~(number/10);
        i++;
        if (i % space === 0) {
            res += ' ';
        }
        res += char;
    }
    return res.split("").reverse().join("");
}

function calculateRightText(text) {
    let number = textToInt(text);
    number = validateSum(number);
    return stringify(number);
}

function textToInt(text) {
    let number = 0;
    for (let i = 0; i < text.length; i++) {
        if (text.at(i) >= '0' && text.at(i) <= '9') {
            number = number * 10 + (text.at(i) - '0');
        }
    }
    return number;
}

function validateSum(number) {
    if (number > 29999) {
        number = 29999;
    }
    if (number < 10) {
        moneyRoot.classList.add("error");
        moneyErrorMsg.classList.remove("hidden");
    } else {
        moneyRoot.classList.remove("error");
        moneyErrorMsg.classList.add("hidden");
    }
    if (number > 0) {
        moneyRoot.classList.remove("empty");
    }
    checkButton();
    return number;
}
function moveCursorRight(elem = moneyInput) {
    const range = document.createRange();
    range.selectNodeContents(elem);
    range.collapse();
    const selection = window.getSelection();
    selection.removeAllRanges();
    selection.addRange(range);
}

function plusButtonClicked(elem) {
    let number = textToInt(moneyInput.innerText);
    switch (plusButtons.indexOf(elem.currentTarget)) {
        case 0: {
            number += 100;
            break;
        }
        case 1: {
            number += 500;
            break;
        }
        case 2: {
            number += 1000;
            break;
        }
        default: {
            return;
        }
    }
    moneyInput.innerText = stringify(validateSum(number));
}

moneyInput.addEventListener("input", e => {
    let text = moneyInput.innerText;
    moneyInput.innerText = calculateRightText(text.trim());
    moveCursorRight();
    if (moneyInput.innerText === "") {
        moneyRoot.classList.add("empty");
    } else {
        moneyRoot.classList.remove("empty");
    }
})

moneyInput.addEventListener("keydown", () => blockBadKeys(moneyInput))
cardInput.addEventListener('input', formatCardNumber);
cardInput.addEventListener('blur', validateCardNumber);

monthInput.addEventListener('input', formatExpiryMonth);
monthInput.addEventListener('blur', validateExpiryField);

yearInput.addEventListener('input', formatExpiryYear);
yearInput.addEventListener('blur', validateExpiryField);

cvvInput.addEventListener('input', formatCvv);
cvvInput.addEventListener('blur', validateCvv);

function formatCardNumber(event) {
    const input = event.target;
    let value = input.value.replace(/\D/g, '');

    if (value.length > 16) {
        value = value.slice(0, 16);
    }

    if (value.length === 0) {
        input.classList.remove("active")
    } else {
        input.classList.add("active")
    }

    if (value.length === 16) {
        validateCardNumberOnInput(input);
    }
    input.value = value.replace(/(\d{4})(?=\d)/g, '$1 ');
}

function validateCardNumber(event) {
    const input = event.target;
    validateCardNumberOnInput(input);
}
function validateCardNumberOnInput(input) {
    const parentElement = input.parentElement;
    const value = input.value.replace(/\s/g, '');

    if (value.length === 0) {
        document.getElementById("card-number-error").innerText = "Enter your card number";
    } else {
        document.getElementById("card-number-error").innerText = "Invalid card number";
    }
    if (value.length !== 16 || !luhnCheck(value)) {
        parentElement.classList.add('invalid');
    } else {
        parentElement.classList.remove('invalid');
    }

    const feeWarning = document.querySelector('.foreign-fees');
    if (value.length >= 6) {
        const bin = parseInt(value.substring(0, 6), 10);
        if (urkBins.includes(bin)) {
            feeWarning.textContent = '';
        } else {
            feeWarning.textContent = '2% processing fee for non-Ukrainian cards';
        }
    } else {
        feeWarning.textContent = '';
    }
    checkButton();

}

function luhnCheck(cardNumber) {
    let sum = 0;
    let shouldDouble = false;
    for (let i = cardNumber.length - 1; i >= 0; i--) {
        let digit = parseInt(cardNumber[i], 10);

        if (shouldDouble) {
            digit *= 2;
            if (digit > 9) {
                digit -= 9;
            }
        }
        sum += digit;
        shouldDouble = !shouldDouble;
    }

    return sum % 10 === 0;
}

function formatExpiryMonth(event) {
    const input = event.target;
    let value = input.value.replace(/\D/g, '');

    if (value.length === 0) {
        input.classList.remove("active")
    } else {
        input.classList.add("active")
    }

    if (value.length > 2) {
        value = value.slice(0, 2);
    }

    if (value.length === 2) {
        const month = parseInt(value, 10);
        if (month > 12) {
            value = '12';
        } else if (month === 0) {
            value = '01';
        }
    }
    if (value.length === 2) {
        validateExpiryField(event);
        moveToNextInput(yearInput);
    }
    input.value = value;
}


function formatExpiryYear(event) {
    const input = event.target;
    let value = input.value.replace(/\D/g, '');

    if (value.length === 0) {
        input.classList.remove("active")
    } else {
        input.classList.add("active")
    }

    if (value.length > 2) {
        value = value.slice(0, 2);
    }
    if (value.length === 2) {
        validateExpiryField(event);
        moveToNextInput(cvvInput);
    }
    input.value = value;
}

function formatCvv(event) {
    const input = event.target;
    let value = input.value.replace(/\D/g, '');

    if (value.length === 0) {
        input.classList.remove("active")
    } else {
        input.classList.add("active")
    }

    if (value.length > 3) {
        value = value.slice(0, 3);
    }
    if (value.length === 3) {
        validateCvv(event);
    }
    input.value = value;
}
function validateCvv(event) {
    const input = event.target;
    const parentElement = input.parentElement;
    const value = input.value;

    if (value.length !== 3) {
        parentElement.classList.add('invalid');
    } else {
        parentElement.classList.remove('invalid');
    }
    checkButton();
}



function validateExpiryField(event) {
    const input = event.target;
    const parentElement = input.parentElement;
    const value = input.value;

    if (value.length !== 2) {
        parentElement.classList.add('invalid');
    } else {
        parentElement.classList.remove('invalid');
    }
    checkButton();
}

function checkButton() {
    const invalidElements = document.querySelectorAll('.invalid, .error');
    const payButton = document.getElementById('btn');
    if (invalidElements.length > 0) {
        payButton.disabled = true;
    } else {
        payButton.disabled = moneyInput.innerText === '0' || moneyInput.innerText === '' || cardInput.value === '' || monthInput.value === '' || yearInput.value === '' || cvvInput.value === '';
    }
}
